import {
    Select,
    MenuItem,
    FormControl,
    InputLabel,
    TextField,
    DialogTitle,
    Button
} from '@mui/material';
import { useEffect, useState } from 'react';
import { AddOrders, getAllOrders, getInventory, updateOrder } from '../Api/Api';

const OrderState = {
    inventoryid: '',
    inventoryname: '',
    price: '',
    ordertype: '',
    quantity: '',
    customername: '',
    customerphone: '',
    customerlocation: '',
    paymentstatus: '',
    orderstatus: ''
};

const OrderPage = () => {
    const [dataList, setDataList] = useState([]);
    const [selectedOrder, setSelectOrder] = useState(OrderState);

    useEffect(() => {
        const fetchInventory = async () => {
            const result = await getInventory();
            setDataList(result?.data || []);
        };
        fetchInventory();
    }, []);

    useEffect(() => {
        fetchOrder()
    }, [])
    const fetchOrder = async () => {
        const result = await getAllOrders()
        setSelectOrder(result?.data || [])
    }
    const handleSelect = (e) => {
        const { name, value } = e.target;
        setSelectOrder((prev) => ({
            ...prev,
            [name]: value
        }));
        console.log("Updated selectedOrder:", {
            ...selectedOrder,
            [name]: value
        });
    };


    const handlesave = async (data) => {
        try {
            const orderPayload = {
                inventoryid: selectedOrder.id,
                inventoryname: selectedOrder.inventoryname,
                price: selectedOrder.price,
                ordertype: selectedOrder.ordertype,
                quantity: selectedOrder.quantity,
                customername: selectedOrder.customername,
                customerphone: selectedOrder.customerphone,
                customerlocation: selectedOrder.customerlocation,
                paymentstatus: selectedOrder.paymentstatus,
                orderstatus: selectedOrder.orderstatus
            };

            let response;

            if (selectedOrder.id != null) {
                response = await updateOrder(selectedOrder.id, orderPayload)
            } else {
                response = await AddOrders(orderPayload);
            }
            alert(response.message);
            fetchOrder(); // Fetch updated list
        } catch (error) {
            console.error("placing Order Error:", error.response?.data || error.message);
            alert("Failed to place Order: " + (error.response?.data?.message || "Unknown error"));
        }
    };
    console.log("data is getting")
    return (
        <div>
            {/* Select Item */}
            <DialogTitle>Product Details</DialogTitle>
            <FormControl size="small" sx={{ width: 300, mb: 2 }}>
                <InputLabel id="item-label">Item</InputLabel>
                <Select
                    labelId="item-label"
                    name="Item"
                    value={selectedOrder.Item} // You missed this
                    onChange={handleSelect}
                >
                    {dataList?.map((item) => (
                        <MenuItem key={item.id} value={item.inventoryName}>
                            {item.inventoryName}
                        </MenuItem>
                    ))}
                </Select>
            </FormControl>

            {/* Select Order Type */}
            <FormControl size="small" sx={{ width: 300 }}>
                <InputLabel id="order-type-label">Order Type</InputLabel>
                <Select
                    labelId="order-type-label"
                    name="OrderType"
                    value={selectedOrder.OrderType}
                    onChange={handleSelect}
                >
                    <MenuItem value="Sell">Sell</MenuItem>
                    <MenuItem value="Rent">Rent</MenuItem>
                </Select>
            </FormControl>
            <br />
            <TextField
                label="Quantity"
                name="Quantity"
                type="number"
                value={selectedOrder.Quantity}
                onChange={handleSelect}
                sx={{ width: 600 }}
            />
            <DialogTitle>Customer Details</DialogTitle>
            <TextField
                label="Customer Name"
                name="CustomerName"
                value={selectedOrder.CustomerName}
                onChange={handleSelect}
                sx={{ width: 300 }}
            />
            <TextField
                label=" Phone Number"
                name="CustomerPhoneNum"
                type='number'
                value={selectedOrder.CustomerPhoneNum}
                onChange={handleSelect}
                sx={{ width: 300 }}
            />
            <br />
            <TextField
                label="Location"
                name="CustomerLocation"
                value={selectedOrder.CustomerLocation}
                onChange={handleSelect}
                sx={{ width: 600 }}
            />
            <br />
            <FormControl sx={{ width: 600 }}>
                <InputLabel id="PaymentStatus">PaymentStatus</InputLabel>
                <Select
                    labelId="Payment Status"
                    name="PaymentStatus"
                    value={selectedOrder.PaymentStatus}
                    onChange={handleSelect}
                >
                    <MenuItem value="Paid">Paid</MenuItem>
                    <MenuItem value="Partially Paid">Partially Paid</MenuItem>
                    <MenuItem value="Un Paid">Un Paid</MenuItem>

                </Select>
                <Button onClick={handlesave}>save</Button>

            </FormControl>
        </div>
    );
};

export default OrderPage;
